    false,nt"url": null,nt"notes": "This data set includes data collected on
    April 3rd, 1998 in the the states of Maryland and Virgina along the DelMarVa peninsula.
    Laser beach mapping uses a pulsed laser ranging system mounted onboard an aircraft
    to measure ground elevation and coastal topography. The laser emits laser beams
    at high frequency and is directed downward at the earth's surface through a port
    opening in the bottom of the aircraft's fuselage. The laser system records the time
    difference between emission of the laser beam and the reception of the reflected
    laser signal in the aircraft. The aircraft travels over the beach at approximately
    60 meters per second while surveying from the low water line to the landward base
    of the sand dunes.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
